// Combine all the sort conditions into a single sort ranking function
function ranking (rank){
rank.sort((a, b) => {
if (b.counts.VH !== a.counts.VH) {
return b.counts.VH - a.counts.VH;
} else if (b.counts.H !== a.counts.H) {
return b.counts.H - a.counts.H;
} else if (b.counts.M !== a.counts.M) {
return b.counts.M - a.counts.M;
} else if (b.counts.L !== a.counts.L) {
return b.counts.L - a.counts.L;
} else {
return b.counts.VL - a.counts.VL;
}
});
return rank;
}
